import './App.css';
import FunctionalComp from './components/FunctionalComponent'
import ClassComp from './components/ClassComponent'
import React from 'react'
//app .js jest głownym komponentem który zostaje wyrenderowany do DOM
//app .js functional komponent
//Default importa mozna nazwać jak się chce
function App() {
    return (
        <div>
            <h1>test101</h1>
            <FunctionalComp></FunctionalComp>
            <ClassComp></ClassComp>
            <Parent></Parent>
        </div>      
    );

}


class Parent extends React.Component{
    render(){
        return(
            <Child m="message for child"/>
        );
    }
}


class Child extends React.Component{
    render(){
        const Books = [
            {
                id:1,
                tytul:"Arthas - Przebudzenie Króla Lisza",
                autor:"Christie golden",
                liczbaStron: 365,
                gatunek: "Fantasy",
                uniwersum: "Warcraft"

            },
            {
                id:2,
                tytul:"Illidan",
                autor:"William King",
                liczbaStron: 414,
                gatunek: "Fantasy",
                uniwersum: "Warcraft"
            },
            {
                id:3,
                tytul:"Fale ciemności",
                autor:"Aaron Rosenberg",
                liczbaStron: 324,
                gatunek: "Fantasy",
                uniwersum: "Warcraft"
            }
        ];

        return(
            <div>
                {Books.map(function(Book){
                        return(
                            <div key={Book.id}></div>
                        )
                    })
                }
            </div>
        )
    }
}




export default App;
